import React from "react";
import { Link } from 'react-router-dom';

const Reports = () => {
    return(
        <>
        <Link to="/home">
            <button className="btn btn-success mx-2">
                Back
            </button>
        </Link>
        <div>This is report </div>
        </>
    )
}
export default Reports;
